import {useState} from 'react';
function Mid3() {
    const [students, setStudent]= useState([
        {name:'ameen',address:"jaipur",rollno:254,id:1},
        {name:'Jitendra',address:"Delhi",rollno:255,id:2}
    ]);
    return ( 
        <div>
            {students.map((result)=>(
                <div key={result.id}>
                <h1>{result.name}</h1>
                <p>Address is {result.address} and roll no is{result.rollno}</p>
                </div>
            ))}
        </div>
     );
}

export default Mid3;
